import React, { useState } from "react";
import axios from "axios";
import { connect } from "react-redux";
import { Navigate } from "react-router-dom";
import { SERVER_URL } from "../../auth/Consts";
import { Box, MenuItem, TextField, Button } from "@mui/material";
import {toast} from "react-toastify";

//components
import defaultImage from '../../../src/resources/images/favicon.jpg';

function addEventForm(props) {

    const [name, setName] = useState("");
    const [location, setLocation] = useState("");
    const [date, setDate] = useState("");
    const [time, setTime] = useState("");
    const [image, setImage] = useState(null);
    const [details, setDetails] = useState("");

    const notify = () => toast.success('Event created successfully!', {
        position: "top-right",
        autoClose: 5000,
        hideProgressBar: false,
        closeOnClick: true,
        pauseOnHover: true,
        draggable: true,
        progress: undefined,
        theme: "light",
    });

    function callFuns() {
        props.closeModal();
        toast.success('Event created successfully!', {
            position: "top-right",
            autoClose: 5000,
            hideProgressBar: false,
            closeOnClick: true,
            pauseOnHover: true,
            draggable: true,
            progress: undefined,
            theme: "light",
        });
    }
    const handleKeyPress =(event) =>{

        if (event.key === 'Enter') {
            callFuns();
        }
    }

    return (
        <form encType="multipart/form-data" onKeyPress={handleKeyPress}>
            <Box mb={1}>
                <TextField
                    select
                    className="custom-input"
                    label="Select sport"
                    variant="outlined"
                    value={sport}
                    onChange={(e) => setSport(e.target.value)}
                >
                    {hasSports.map((sport) => (
                        <MenuItem
                            key={sport.pk}
                            value={sport.pk}
                            style={{display: "block", paddingLeft: "1rem"}}
                        >
                            {sport.fields.name}
                        </MenuItem>
                    ))}
                </TextField>
            </Box>

            <Box mb={1}>
                <TextField
                    className="custom-input"
                    label="Name"
                    variant="outlined"
                    onChange={(e) => setName(e.target.value)}
                    inputProps={{ maxLength: 30 }}
                />
            </Box>
            <Box mb={1} className="d-flex">
                <TextField
                    sx={{ margin: "0 1rem 0 0" }}
                    className="custom-input"
                    id="start"
                    label="Working hours from"
                    type="time"
                    value={start}
                    onChange={(e)=>setStart(e.target.value)}
                    variant="outlined"
                    InputLabelProps={{ shrink: true }}
                />
                <TextField
                    sx={{ margin: "0 0 0 1rem" }}
                    className="custom-input"
                    id="end"
                    label="Working hours to"
                    type="time"
                    value={end}
                    onChange={(e)=>setEnd(e.target.value)}
                    variant="outlined"
                    InputLabelProps={{ shrink: true }}
                />
            </Box>

            <Box mb={1}>
                <TextField
                    className="custom-input"
                    variant="outlined"
                    label="Location"
                    onChange={(e) => setLocation(e.target.value)}
                />
            </Box>

            <Box mb={1}>
                <TextField
                    className="custom-input"
                    variant="outlined"
                    label="Price"
                    onChange={(e) => setPrice(e.target.value)}
                />
            </Box>

            <Box mb={1}>
                <TextField
                    className="custom-input"
                    type="file"
                    id="formBasicImg"
                    label="Image"
                    variant="outlined"
                    onChange={(e) => setImages(e.target.files)}
                    inputProps={{ multiple: true }}
                    InputLabelProps={{ shrink: true }}
                />
            </Box>

            {!images && (
                <Box mb={1}>
                    <img src={defaultImage} alt="Default" width="200" height="200" style={{ display: "none" }} />
                </Box>
            )}

            <Box mb={3}>
                <TextField
                    className="custom-input"
                    id="description"
                    name="description"
                    label="Description"
                    multiline
                    rows={3}
                    fullWidthrequired
                    onChange={(e) => setDescription(e.target.value)}
                />
            </Box>

            <Box textAlign="center">
                <Button className="custom-button mt-2" onClick={callFuns}>
                    {props.action}
                </Button>
            </Box>
        </form>
    );
}
export default addEventFrom;
